import { ThreeCircles } from "react-loader-spinner";
export const Loader = () => {
  return (
    <>
      <ThreeCircles
        height="100"
        width="100"
        color="#4fa94d"
        wrapperStyle={{ margin: "0 auto" }}
        wrapperClass=""
        visible={true}
        ariaLabel="three-circles-rotating"
        outerCircleColor=""
        innerCircleColor=""
        middleCircleColor=""
      />
    </>
  );
};
